【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 電池を替えるだけで、1台の工具が18Vにも、14.4Vにも。作業に応じて使い分け可能。<br /><br />★ 18V 4.2Ah(LSタイプ)電池を装着して、わずか2.6kg。工具本体は従来の14.4V(当社EZ7840)と同サイズ。上向き作業でも片手でラクに扱える。<br /><br />★ ハンマーモードとドリルドライバーモードで穴あけ、ネジ締めにマルチに使用できる。<br /><br />★ 突然の雨、思わぬ水しぶき、悩ましいほこりや粉塵の影響を抑える耐水・防塵設計。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 防塵・耐水設計: IP56<br />* コンクリート穴あけ(径12.5×深さ40mm): 18V=約45穴 、14.4V=約40穴<br />* 電池: 4.2Ah<br />* セット電池内容: 18V 4.2Ah(LSタイプ)電池<br />* 付属品: プラスチックケース、急速充電器(リチウムイオン専用)、電池パックLSタイプ(2個)、ビットアダプター(SDSプラス型シャンク)、マルチハンマードリル(EZ78A1)用集塵カップ、肩掛けベルト</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
