【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 新搭載「自動変速」で穴あけが手早く、工具への負担も軽減できます。<br /><br />★ コンパクトドリルで連続穴あけがスムーズです。<br /><br />★ 穴あけ作業<br /><br />★ ネジ締め作業<br /><br />★ 建築業</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 無負荷回転数(min[[の-1乗]])高速:160～1400<br />* 無負荷回転数(min[[の-1乗]])低速:60～400<br />* 最大締付トルク(N・m)高速:10<br />* 最大締付トルク(N・m)低速:28<br />* 質量(kg):1.9<br />* 締め付け能力:高速モード:木ネジ・米松(φ4.1×25mm)約1200本、穴あけ:オートモード:木工・米松(φ18×120mm)約95穴<br />* 充電時間:38分(実用充電)、54分(フル充電)<br />* リチウムイオン電池パック(EZ9L45)2個<br />* 充電器(EZ0L81)<br />* ケース(EZ9644)<br />* 原産国: 中国</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
